import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Profile.css';

const Profile = () => {
  const navigate = useNavigate();
  const userDetailsString = localStorage.getItem('userDetails');
  const userDetails = userDetailsString ? JSON.parse(userDetailsString) : null;

  if (!userDetails) {
    console.log('No user details found in localStorage');
    // Handle the case where no user details are found, e.g., redirect to login
    // navigate('/login');
  }

  const handleLogout = () => {
    localStorage.removeItem('isAuthenticated');
    localStorage.removeItem('userDetails');
    navigate('/login');
  };

  return (
    <div className="profile-container">
      <h1>Your Profile</h1>
      <div className="profile-details">
        <p>Username: {userDetails ? userDetails.username : 'N/A'}</p>
        <p>Email: {userDetails ? userDetails.email : 'N/A'}</p>
        <p>Phone Number: {userDetails ? userDetails.phone_number : 'N/A'}</p>
        <p>First Name: {userDetails ? userDetails.first_name : 'N/A'}</p>
        <p>Last Name: {userDetails ? userDetails.last_name : 'N/A'}</p>
      </div>
      <button onClick={handleLogout}>Sign Out</button>
    </div>
  );
};

export default Profile;
